import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Cookies from 'universal-cookie';
import { trackPromise} from 'react-promise-tracker';

// const TICKET_URL = 'http://localhost:8000/api/ticket-numbers';
import { usePromiseTracker } from "react-promise-tracker";
 
export const LoadingSpinerComponent = (props) => {
    const { promiseInProgress } = usePromiseTracker();
 
  return (
    <div>
    {
      (promiseInProgress === true) ?
        <h3>Hey I'm a spinner loader wannabe !!!</h3>
      :
       null
    }
  </div>
  )
};

const Other = (props) => {
    const getToken = localStorage.getItem('userToken');
    
    const TICKET_URL = `http://localhost:8000/api/ticket-list/${getToken}`;
    
    const [tickets, setTickets] = useState({});

    const { promiseInProgress } = usePromiseTracker({area: props.area});

    useEffect(() => {
        const getTickets = async () => {
            if(getToken)
            {
                const {data: res} = await axios.get(TICKET_URL)
                setTickets(res);
            }
        }
        getTickets();
    }, [])
    
    return(
        <>
            <div>
                {!promiseInProgress && (
                    <p>Loading....</p>
                )}
                {tickets.tickets?.map((ticket)=> (
                    <p>{ticket.name}</p>

                )
                )}
            </div>
        </>
    )
}

export default Other;
